const initialState = {
  currentPage: "SwipeScreen",
};

export default (state = initialState, action) => {

  switch (action.type) {
    case "UPDATE_CURRENT_PAGE":
      return { ...state,
        currentPage: action.payload.newPage }
    default:
      return state;
  }
}
